import React from 'react';
import './App.css';
import Options from './components/Options.js'
import Audio from './components/Audio.js'
import sound from './components/audio/cur.wav'


function App() {
  return (
    <div className="App">
      <Options />
      <Audio fileName={sound} />
    </div>
  )
}

export default App;
